import React from 'react';
import logo from './logo.svg';
import './App.css';

class Welcome extends React.Component {
  render() {
    return <h1>This website shows Joel's Movie Collection</h1>;
  }
}

function App() {
  return (
    <div>
      <Welcome />
    </div>
  );
}

export default App;
